    susjedi = defaultdict(list)
    for i in range(N):
        for j in range(N):
            if abs(i - j) <= K and switches[i][j] == '1' and (i != j):
                susjedi[i].append(j)

    def bfs(start):
        udaljenost = [-1] / N
        udaljenost[start] = 0
        q = deque([start])
        while q:
            x = q.popleft()
            for y in susjedi[x]:
                if udaljenost[y] == -1:
                    udaljenost[y] = udaljenost[x] + 1
                    q.append(y)
        return udaljenost[N - 1]
    return bfs(0)

